    function showNextStepTips(e) {
        e.preventDefault();
        var current = $(e.currentTarget);
        var stage = $(current).closest('.js-stage');
        var activeStep = $(stage).find('.js-step.active');
        var nextStep = $(activeStep).next('.js-step');
        var nextStage = $(stage).next('.js-stage');
        var nextStageStep = $(nextStage).find('.js-step:first-child');

        if (nextStep.length) {
            activeStep.removeClass('active');
            nextStep.show().addClass('active');
            TweenMax.fromTo(nextStep, 0.3, {opacity:"0", x:"0%"},{opacity:"1", x:"0%", ease:Power0.easeInOut});
            TweenMax.fromTo(activeStep, 0.3, {opacity:"1", x:"0%"}, {x:"100%", opacity:"0", ease:Power0.easeInOut, onComplete: hideStep, onCompleteParams: [activeStep]});
       } else {
            if (nextStage.length ) {
                stage.removeClass('active');
                nextStage.addClass('active');
                nextStageStep.show().addClass('active');
                TweenMax.to(stage, 1, {opacity:"0", ease:Power2.easeInOut});
                TweenMax.to(nextStage, 1, {opacity:"1", ease:Power2.easeInOut});
                TweenMax.to(nextStageStep, 1, {opacity:"1", ease:Power2.easeInOut});
            } else {
                hideSection();
            }
       }
    }


    function showPrevStepTips(e) {
        e.preventDefault();
        var current = $(e.currentTarget);
        var stage = $(current).closest('.js-stage');
        var activeStep = $(stage).find('.js-step.active');
        var prevStep = $(activeStep).prev('.js-step');
        var prevStage = $(stage).prev('.js-stage');
        var prevStageStep = $(prevStage).find('.js-step:last-child');

         if (prevStep.length) {
            activeStep.removeClass('active');
            prevStep.show().addClass('active');
            TweenMax.fromTo(activeStep, 0.3, {opacity:"1"}, {opacity:"0",ease:Power0.easeInOut, onComplete: hideStep, onCompleteParams: [activeStep]});
            TweenMax.fromTo(prevStep, 0.3,{opacity:"0", x:"100%"}, {opacity:"1", x:"0%", ease:Power0.easeInOut});
         } else {
            if (prevStage.length) {
                stage.removeClass('active');
                prevStage.addClass('active');
                prevStageStep.show().addClass('active');
                TweenMax.to(stage, 1, {opacity:"0", ease:Power2.easeInOut});
                TweenMax.to(prevStage, 1, {opacity:"1", ease:Power2.easeInOut});
                TweenMax.to(prevStageStep, 1, {opacity:"1", ease:Power2.easeInOut});
            } else {
                hideSection();
                showRules();
            }
         }
    }

    



    function hideSection(){
        var section = $('.js-section.active');
        var stage = $(section).find(".js-stage.active");
        var step = $(stage).find('.js-step.active');
    //right nav
        var stageNavs = $(section).find('.js-stage-nav');
        var stepNavs = $(section).find('.js-step-nav');

        stageNavs.removeClass('active');
        stageNavs.removeClass('focus');

        stepNavs.removeClass('active');
        stepNavs.removeClass('focus');

        section.removeClass('active');
        stage.removeClass('active');
        step.removeClass('active');


        TweenMax.fromTo(stage, 1, {x:"-50%", y:"-50%", opacity:"1"},{x:"0%", y:"-50%", opacity:"0",ease:Power2.easeInOut});
       	var stageTitle = $(stage).find('.js-stage-description');
       	TweenMax.fromTo(stageTitle, 1, {x: "0%"}, {x:"50%", ease:Power2.easeInOut});

        TweenMax.to(section, 1, {opacity:"0", ease:Power2.easeInOut});
        TweenMax.to(step, 0.5, {opacity:"0", ease:Power2.easeInOut, onComplite: hideAllItems});
        
        hideNavLine();
    }


